                              <div style="text-align: left; font-size: 13px; font-weight: 300; font-family: Roboto, Arial, Helvetica, Arial;">Dear {{$full_name}}<br>Thanks very much for registration in KEMEDAR Systems..Your one step way to Real estate world. <br><br>Kemedar Prop-tech system is a real estate marketplace that will do revolutionary changes in the way people are selling, buying, renting, finishing, investing, or promoting their properties whether they are individuals or companies<br><br>Kemedar<br>In Kemedar you can enjoy many services completely free of charge. You can sell and buy real estate for free in a very easy and simple way and directly contact the owners and buyers. Specialized programs and many benefits for all those interested in real estate, such as agents, real estate developers, as well as freelancer marketers and investors in the real estate field. And thanks our network of area franchise owners covering all areas of the countries in which we operate, we can help you check, review, verify and secure your deal and also finish, furnish and invest your properties in the best way.<br><br>Kemetro<br>Kemetro is the e-commerce portal of Kemedar and is the first portal of its kind that specializes only in selling high quality home building and finishing products. You can find and order everything you need for your home from cement to furniture in one place which makes Kemetro Gate very unique. Our customers can compare a wide range of products from thousands of manufacturers and distributors and get the best prices with a complete satisfaction guarantee that they offer exclusively to Kemetro customers.<br><br>Kemework<br>In this unique system, you can post your home finishing task, collect quotes for it from professionals and assign the task to specific one . After the professional finish your task, you can evaluate him and put review on the system. <br><br>Kemedar Reit<br>KEMEDAR REIT investment portal is specialized in organizing the whole investment process in Real estate generating monthly income. Our investors are just invest in a property that generates monthly or annual income, not in investment by resale of this property. <br><br>Kemmeta<br>Kemmeta Community is the first social network dedicated to the real estate sector and connects all people interested in real estate from all over the world such as sellers, buyers, investors, advertisers, employees, job seekers, contractors, developers, agents, @@.etc. You can enjoy connecting people with the same interests and creating your perfect network in the first dedicated real estate community<br><br>Kemenews<br>Any decision you make in the real estate industry must be based on true information from reliable sources. From this standpoint, we set out in Kemedar to gather the most important and reliable news for our visitors so that they can take the right decision at the right time. Reliable news from a network of our representatives on the ground that is one of the strongest networks in its field.<br><br>Kemedar Academy<br>Kemedar Academy is a non-profit organization whose goal is to raise the technical and professional level of all those working in the real estate industry, from craftsmen and technicians to marketers and Freelancers. There are also specialized programs for real estate agents and investors. Professional volunteers with great experience who like to give their experiences to benefit others, free of charge for the Academy&rsquo;s students@ Specialized programs for training children and youth.<br><br><br>Thanks again and looking forward to servicing you best<br>Kemedar.com<br>The best is yet to come<br><br></div>
